L'administration d'aliments ou de médicaments par voie entérale (en grec, enteros = intestin) se fait par l'intermédiaire du tube digestif. Pour les aliments, il y a deux voies entérales : 
*  Per os (par la bouche) ; exemples : aliments classiques et solution hyperprotéinique. 
*  Par sonde ; exemple : sondage naso-gastrique. Pour les médicaments, il y a trois principales voies entérales : 
*  voie buccale ;  
*  voie orale ;  
*  voie rectale.

